automatic_backup_failed_agents_addons_fo.description:
Automatinė atsarginė kopija buvo sukurta su klaidomis: 
 * Vietos, į kurias nepavyko įkelti atsarginės kopijos: {failed_agents} 
 * Priedai, kurių atsarginių kopijų nepavyko sukurti: {failed_addons} 
 * Aplankai, kurių atsarginių kopijų nepavyko sukurti: {failed_folders} 

 Daugiau informacijos rasite Core ir Supervisor žurnaluose. Jei sukonfigūruotas atsarginės kopijos kūrimo grafikas, bus bandoma sukurti dar kartą kitą kartą suplanuotu laiku.
